	function openPdfAction(){
		let doc = structuredClone(docDefault)
		let out_arr = []
		let tr = document.querySelector('tbody').querySelectorAll("tr")
		
		let sum = 0
		for(let i=0; i<tr.length; i++){
			let a = []
			a.push(i+1)
			let inp = tr[i].querySelectorAll('input')		
			if(inp[0].value == "Итого"){
				sum = inp[4].value
			}
			for(let j=0; j<inp.length; j++){
				let ob = {}
				if(j>0){
					ob.alignment = "center"
				}
				if(sum){
					ob.bold = true
				}
				ob.text = inp[j].value
				a.push(ob)
			}
			out_arr.push(a)
		}
		
		for(let i=0; i<out_arr.length; i++){
			doc['content'][6]['table']['body'].push(out_arr[i])
		}

		let inputs = document.querySelectorAll('.wrapp_input_dogov input')
		doc['content'][3]['text'] = inputs[2].value

		insertTextDogovor(doc)


		doc['content'][5]['text'] = "Приложение 1 к договору № "+inputs[0].value
 		doc['content'][9]['columns'][1]['text'].push(inputs[1].value)
		pdfMake.createPdf(doc).open({}, window.open())
		// pdfMake.createPdf(docDefinition).download(`Счет_потолки№${numbPrice}.pdf`)
	}
	 
	document.querySelector("button[name=total]").addEventListener('click', totalAction)

	document.querySelector("button[name=open]").addEventListener("click", openPdfAction) 
	
